    <div className="container">
        <div className="row">
            <div className="col-1">< Head/></div>

            <div className="col-6">132</div>

            <div className="col-5">< Heading/></div>
        </div>
    </div>
  );
}

const Heading = () => {
    return (
        <div className="App">
            <p>
                123456789
            </p>
        </div>
    );
}
export default App;
